import React, { Component  } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './cv.css';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Aos from "aos";
import "aos/dist/aos.css";



const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor:"#262626",
    paddingLeft: "2rem",
    paddingRight: "2rem",
    paddingBottom: "2rem",
    paddingTop: "2rem",

    
  },
  paper: {
    
    textAlign: 'center',
    color: "#fff",
    fontSize: "44px",
    fontWeight: "700",
    
  },

}));


export default function FullWidthGrid() {
  const classes = useStyles();

  
  
    Aos.init({duration: 2000,
      disable: 'mobile'});
    

  return (
    <div className={classes.root}>
      <Grid container spacing={8}>
        <Grid item xs={12}>
        <Typography data-aos="fade-left" variant="h2" color="" className={classes.paper} component="h1">
          2019
          </Typography>
          
        </Grid>
        
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          
          <div data-aos="fade-right" className="container textpara">
          
          <CardContent>
          
          <Typography variant="body2" color="" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
            across all continents except Antarctica
            across all continents except Antarctica
          </Typography>
        </CardContent>
        </div>
            
            
            
        </Grid>
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          <div data-aos="zoom-in" className="container card1">
          
          <CardMedia
        className={classes.imgs}
          component="img"
          alt="Contemplative Reptile"
          height="290"
          
          image={process.env.PUBLIC_URL+"react.png"}
          
        />
</div>

        </Grid>

        <Grid item xs={12}>
        <Typography data-aos="zoom-in" data-aos-delay="300" variant="h2" color="" className={classes.paper} component="h1">
          2017
          </Typography>
          
        </Grid>
        
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          
          <div data-aos="fade-right" className=" container  boxes">
          
          <CardContent>
          
          <Typography variant="body2" color="" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
            across all continents except Antarctica
            across all continents except Antarctica
          </Typography>
        </CardContent>
        </div>
            
            
            
        </Grid>
        <Grid item xs={12} sm={6} md={6} className={classes.content}>
          <div data-aos="zoom-in" className="container card1">
          
          <CardMedia
        className={classes.imgs}
          component="img"
          alt="Contemplative Reptile"
          height="290"
          
          image={process.env.PUBLIC_URL+"bootstrap.jpg"}
          
        />
</div>

        </Grid>

        </Grid>
    </div>
  );
}
